import React from "react";
import { RunForceGraph } from "../components/ForceGraphGenerator";
import styles from "../components/ForceGraph.css";

export function ForceGraph({ linksData, nodesData, graph}) {
  const containerRef = React.useRef(null);

  React.useEffect(() => {
    let destroyFn;


      if (containerRef.current) {
        <RunForceGraph containerRect={containerRef.current} linksData={linksData} nodesData={nodesData} graph={graph}/>;
        const { destroy } = <RunForceGraph containerRect={containerRef.current} linksData={linksData} nodesData={nodesData} graph={graph}/>;
        destroyFn = destroy;
      }

    return destroyFn;
  }, []);

  return <div ref={containerRef} className={styles.container}/>;
}
